import { Fragment } from 'react';
import { useSelector } from 'react-redux';
import Router from 'next/router';
import Header from '../components/Header';
import RedBackdrop from '../components/RedBackdrop';
import styles from '../styles/scss/landing-page.module.scss';

const Index = () => {
	const jwtToken = useSelector((state) => state.jwtToken);

	if (jwtToken !== '') {
		Router.push('/dashboard/home');
	}

	return (
		<Fragment>
			<span className={styles.landingPageContent}>
				<span>
					<Header />
					<RedBackdrop />
				</span>
				{/* <img
				src={'http://127.0.0.1:8000/storage/sachinkamboj.1@gmail.com/workflow_8/images/hero.jpg'}
				alt={'test'}
			/> */}
				<div className={styles.contentDiv}>
					<section className={styles.content}>
						<section className={styles.text}>
							<h1>Never Deal With Annoying Computer Files Ever Again.</h1>
							<h3>
								YT Workflow is the easiest tool made to help you store all your necessary files all in
								one place, the Cloud.
							</h3>
						</section>
						<section className={styles.img}>
							{/* <h2>Become An Influencer</h2> */}
							<img src={'images/online-video.svg'} alt="Online" />
						</section>
					</section>
				</div>
				<section className={styles.highlights}>
					<div className={styles.highlight}>
						<img src={'images/cloud.svg'} alt="Cloud" width="350" height="350" />
						<h2>Save all your files in the cloud and access them from anywhere.</h2>
					</div>
					<div className={styles.highlight}>
						<img src={'images/share.svg'} alt="Share" width="350" height="350" />
						<h2>Share your workspaces with others and collaborate to make amazing content.</h2>
					</div>
					<div className={styles.highlight}>
						<img src={'images/workflow.svg'} alt="Workflow" width="350" height="350" />
						<h2>Organize your files into worklows to optimize your efficiency.</h2>
					</div>
				</section>
			</span>
		</Fragment>
	);
};

export default Index;
